import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';
import { Button } from './components/Navbar/Button';



ReactDOM.render(
    <BrowserRouter>
        <App />
    </BrowserRouter>
,document.getElementById('root'));

function Navbar(){
    return (
        <div className='App'>
            <Button>signup</Button>
        </div>
    );
}
